import React from "react";
const Blog = (props) => {
  return (
    <div className="mx-5 my-4 bg-dark border-4" style={{ height: "300px" }}>
      <div className="card bg-dark text-light text-md-center">
        <div className="card-body">
          <h5 className="card-title my-5">Special title treatment{props.title}</h5>
          <p className="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Blog;
